import React, { useState } from "react";

const Header = ({isAuthenticated}) => {
    const [logged, setLogged] = useState("로그인");

    if(isAuthenticated == true){
        setLogged("로그아웃");
    } else setLogged("로그인");

    return (
        <React.Fragment>
            <div>
                {logged}
            </div>
        </React.Fragment>
    )
}

export default Header;
